  false,\n\t\"url\": null,\n\t\"notes\": \"Aerial photographs taken by NOAA's National
  Geodetic Survey during 1977 and 1971 were mosaicked and orthorectified by the Biogeography
  Program resulting in a single composite mosaic of both years of photography. The
  resulting image was used to digitize benthic, land cover and mangrove habitat maps
  of the Salt River Bay National Historic Park and Ecological Preserve (National Park
  Service), on St. Croix, in the U.S. Virgin Islands. The composite, rather than a
  single year mosaic, was used because the northward extent and water clarity of photos
  from any single year were inadequate for the project objectives. The mosaic is centered
  on the National Park Service Site, located on the north central coast of St. Croix,
  and extends beyond the park boundaries approximately 3 km to the south, 6 km to
  the west, 4.5 km to the east, and 0.5 km to the north.\",\n\t\"license_title\":
